h {\"style\":{\"typography\":{\"fontSize\":\"25px\"}},\"textColor\":\"vivid-cyan-blue\"} -->\n<p class=\"has-vivid-cyan-blue-color has-text-color\" style=\"font-size:25px\">Quer emplementar um site para a sua empresa ou criar um ecommerce ?! Fale comigo </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->','Inicio','','publish','closed','closed','','home','','','2022-04-04 17:29:20','2022-04-04 20:29:20','',0,'http://localhost/site/?page_id=78',0,'page','',0),(79,1,'2022-04-04 15:54:16','2022-04-04 18:54:16','','Blog','','trash','closed','closed','','blog__trashed','','','2022-04-04 13:09:41','2022-04-04 16:09:41','',0,'http://localhost/site/?page_id=79',0,'page','',0),(81,1,'2022-04-04 13:00:09','2022-04-04 16:00:09','{\n    \"wpkites::custom_logo\": {\n        \"value\": 52,\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2022-04-04 16:00:09\"\n    },\n    \"wpkites::wpkites_logo_length\": {\n        \"value\": \"109\",\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2022-04-04 16:00:09\"\n    }\n}','','','trash','closed','closed','','5ba6c983-0a2d-425a-80c1-5d4452a33268','','','2022-04-04 13:00:09','2022-04-04 16:00:09','',0,'http://localhost/site/2022/04/04/5ba6c983-0a2d-425a-80c1-5d4452a33268/',0,'customize_changeset','',0),(83,1,'2022-04-04 13:03:31','2022-04-04 16:03:31','','Home','','inherit','closed','closed','','78-revision-v1','','','2022-04-04 13:03:31','2022-04-04 16:03:31','',78,'http://localhost/site/?p=83',0,'revision','',0),(84,1,'2022-04-04 13:09:41','2022-04-04 16:09:41','','Blog','','inherit','closed','closed','','79-revision-v1','','','2022-04-04 13:09:41','2022-04-04 16:09:41','',79,'http://localhost/site/?p=84',0,'revision','',0),(85,1,'2022-04-04 13:10:34','2022-04-04 16:10:34','','Contato','','inherit','closed','closed','','35-revision-v1','','','2022-04-04 13:10:34','2022-04-04 16:10:34','',35,'http://localhost/site/?p